const container = document.getElementById('mensagens');
let lastUser = null;
let lastDiv = null;

dados.forEach(dado => {
    if (dado.user !== lastUser) {
        const div = document.createElement('div');
        div.classList.add('mensagem');
        div.innerHTML = `<p class="user">${dado.user} <span class="data">Data: ${dado.data}</span></p>
        <p>${dado.mensagem}</p>`;
        container.appendChild(div);
        lastUser = dado.user;
        lastDiv = div;
    } else {
        const p = document.createElement('p');
        p.innerHTML = `${dado.mensagem}`;
        lastDiv.appendChild(p);
    }

    if (dado.anexos && dado.anexos.length > 0) {
        dado.anexos.forEach(anexo => {
            const img = document.createElement('img');
            img.src = anexo;
            img.alt = 'Anexo';
            img.style.maxWidth = '100%'; // Ajusta o tamanho da imagem
            lastDiv.appendChild(img);
        });
    }
});